import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import * as serviceWorker from "./serviceWorker";
import { BrowserRouter } from "react-router-dom";
import { Provider } from "unstated";
import { createStore, subscribe, dispatch, combineReducers } from "redux";
import Check from "./redux/Check";

const reducer = function(state, action) {
  if (action.type === "ATTACK") {
    return { ...state, user: action.payload };
  }
};
const store = createStore(
  reducer,
  "Peace",
  window.devToolsExtension && window.devToolsExtension()
);

store.subscribe(() => {
  console.log("STORE IS UP", store.getState());
});

store.dispatch({ type: "ATTACK", payload: { username: "A" } });
store.dispatch({ type: "ATTACK", payload: { username: "TH" } });
store.dispatch({ type: "ATTACK", payload: { username: "AR" } });
store.dispatch({ type: "ATTACK", payload: { username: "VA" } });

ReactDOM.render(
  <Provider store={store}>
    <App />
  </Provider>,
  document.getElementById("root")
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
